"672":{"id":"672","name":"Harry Potter e a Câmara Secreta","slug":"harry-potter-e-a-camara-secreta","original_title":"Harry Potter and the Chamber of Secrets","overview":"Carros voadores, árvores que lutam e um misterioso elfo, com um aviso ainda mais misterioso. Harry Potter está pronto para dar início ao segundo ano de sua maravilhosa jornada no mundo da bruxaria. Em Hogwarts nesse ano, aranhas falam, cartas dão broncas e a habilidade de Harry para falar com cobras voltará contra ele. De clubes de duelo a jogadores de quadribol desonestos, esse será um ano de aventura e perigo para todos. Quando a mensagem sangrenta na parede anuncia que a Câmara Secreta foi aberta, Harry, Rony e Hermione percebem que para salvar Hogwarts será preciso muita mágica e coragem. Confira essa enfeitiçante adaptação do segundo livro da obra da escritora J.K. Rowling e prepare-se para ficar petrificado quando Harry Potter demonstrar que, mais que um bruxo, é um verdadeiro herói.","first_air_date":"2002-11-13","runtime":161,"episode_run_time":[161],"vote_average":7.7,"created_by":["Warner Bros. Pictures","Heyday Films","1492 Pictures","MIRACLE Productions"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Heyday Films"},{"name":"1492 Pictures"},{"name":"MIRACLE Productions"}],"cast":["Daniel Radcliffe","Rupert Grint","Emma Watson","Kenneth Branagh","Toby Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/yHzyPJrVqlTySQ9mc379yxrLBYQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/27DNJjNTLpKDsuhqjSjklyPnos4.jpg","certification":"L","genres":["Aventura","Fantasia"],"trailer":"VGi8YwmpW8Y"},
"135397":{"id":"135397","name":"Jurassic World: O Mundo dos Dinossauros","slug":"jurassic-world-o-mundo-dos-dinossauros","original_title":"Jurassic World","overview":"Vinte e dois anos depois dos acontecimentos em Jurassic Park, a Isla Nublar foi transformada num enorme parque temático bem sucedido, o Jurassic Wold, com versões “domesticadas” de alguns dos dinossauros mais conhecidos. Quando tudo parece correr bem e ser o negócio do século, um novo dinossauro de espécie desconhecida, por ter sido criado através da manipulação genética de seu DNA, e que se revela muito mais inteligente do que se pensava, escapa de seu confinamento e começa a causar estragos entre os visitantes do Parque.","first_air_date":"2015-06-06","runtime":125,"episode_run_time":[125],"vote_average":6.7,"created_by":["Amblin Entertainment","Universal Pictures"],"production_companies":[{"name":"Amblin Entertainment"},{"name":"Universal Pictures"}],"cast":["Chris Pratt","Bryce Dallas Howard","Irrfan Khan","Vincent D'Onofrio","Ty Simpkins"],"backdrop_path":"https://image.tmdb.org/t/p/original/aIGIYJTyOkEVUmEd3z5x6diYsFx.jpg","poster_path":"https://image.tmdb.org/t/p/original/gf3FEmT95ZQ5rBfzsaouIUzxKhy.jpg","certification":"12","genres":["Ação","Aventura","Ficção científica","Thriller"],"trailer":"S2_aWPGZwhs"},
