"19995":{"id":"19995","name":"Avatar","slug":"avatar","original_title":"Avatar","overview":"Apesar de não ter mais os movimentos da perna, o ex-fuzileiro naval Jake Sully ainda sente que pode ser um guerreiro. Sua intuição começa a se tornar realidade quando ele viaja anos-luz até a estação espacial montada no Planeta Pandora. Habitado por grandes seres azuis, os Na´vi, o local tem uma atmosfera fatal para qualquer terrestre. Por isso, oficiais criaram o programa Avatar, em que um corpo biológico, híbrido de humano e Na´vi, pode ser comandado a distância.","first_air_date":"2009-12-15","runtime":177,"episode_run_time":[177],"vote_average":7.6,"created_by":["Dune Entertainment","Lightstorm Entertainment","20th Century Fox","Ingenious Media"],"production_companies":[{"name":"Dune Entertainment"},{"name":"Lightstorm Entertainment"},{"name":"20th Century Fox"},{"name":"Ingenious Media"}],"cast":["Sam Worthington","Zoe Saldaña","Sigourney Weaver","Stephen Lang","Michelle Rodriguez"],"backdrop_path":"https://image.tmdb.org/t/p/original/vL5LR6WdxWPjLPFRLe133jXWsh5.jpg","poster_path":"https://image.tmdb.org/t/p/original/iNMP8uzV2Ing6ZCw0IICgEFVNfC.jpg","certification":"10","genres":["Ação","Aventura","Fantasia","Ficção científica"],"trailer":"G1fymUSI4cc"},
"150689":{"id":"150689","name":"Cinderela","slug":"cinderela","original_title":"Cinderella","overview":"Após a trágica e inesperada morte do seu pai, Ella (Lily James) fica à mercê da sua terrível madrasta, Lady Tremaine (Cate Blanchett), e suas filhas Anastasia e Drisella. A jovem ganha o apelido de Cinderela e é obrigada a trabalhar como empregada na sua própria casa, mas continua otimista com a vida. Passeando na floresta, ela se encanta por um corajoso estranho (Richard Madden), sem desconfiar que ele é o príncipe do castelo. Cinderela recebe um convite para o grande baile e acredita que pode voltar a encontrar sua alma gêmea, mas seus planos vão por água abaixo quando a madrasta má rasga seu vestido. Agora, será preciso uma fada madrinha (Helena Bonham Carter) para mudar o seu destino.","first_air_date":"2015-03-06","runtime":105,"episode_run_time":[105],"vote_average":6.8,"created_by":["Walt Disney Pictures","Genre Films","Beagle Pug Films","Allison Shearmur Productions"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Genre Films"},{"name":"Beagle Pug Films"},{"name":"Allison Shearmur Productions"}],"cast":["Lily James","Cate Blanchett","Richard Madden","Stellan Skarsgård","Holliday Grainger"],"backdrop_path":"https://image.tmdb.org/t/p/original/q7vmCCmyiHnuKGMzHZlr0fD44b9.jpg","poster_path":"https://image.tmdb.org/t/p/original/4DsfRsCxrhkHQHGLeY9m8oi9q46.jpg","certification":"L","genres":["Romance","Fantasia","Família","Drama"],"trailer":"U7P4HutYb_M"},
