"882569":{"id":"882569","name":"O Pacto","slug":"o-pacto","original_title":"Guy Ritchie's The Covenant","overview":"Na sua última missão no Afeganistão, o sargento John Kinley junta-se ao intérprete local Ahmed para fazer um levantamento da região. Quando sua unidade sofre uma emboscada, Kinley e Ahmed são os únicos sobreviventes. Com combatentes inimigos em sua perseguição, Ahmed arrisca a própria vida para carregar o ferido Kinley por quilômetros de terreno difícil até um local seguro. De volta ao solo americano, Kinley descobre que Ahmed e sua família não receberam passagem para os Estados Unidos conforme prometido. Determinado a proteger seu amigo e pagar sua dívida, Kinley retorna à zona de guerra para recuperar Ahmed e sua família antes que sejam capturados pelas milícias locais.","first_air_date":"2023-04-19","runtime":123,"episode_run_time":[123],"vote_average":7.8,"created_by":["STXfilms","Toff Guy Films"],"production_companies":[{"name":"STXfilms"},{"name":"Toff Guy Films"}],"cast":["Jake Gyllenhaal","Dar Salim","Sean Sagar","Jason Wong","Rhys Yates"],"backdrop_path":"https://image.tmdb.org/t/p/original/eTvN54pd83TrSEOz6wbsXEJktCV.jpg","poster_path":"https://image.tmdb.org/t/p/original/pTQZT9R6YjKrweJ0llPtq57j1Z0.jpg","certification":"16","genres":["Guerra","Ação","Thriller"],"trailer":"N/A"},
