"1326059":{"id":"1326059","name":"Pimpinero: Sangue e Gasolina","slug":"pimpinero-sangue-e-gasolina","original_title":"Pimpinero: Sangre y gasolina","overview":"No deserto traiçoeiro ao longo da fronteira entre a Colômbia e a Venezuela, contrabandistas de gasolina conhecidos como \"pimpineros\" arriscam suas vidas transportando combustível ilegal. Quando Juan, o caçula de um clã de três irmãos envolvidos nesse perigoso comércio, é forçado a trabalhar para um rival, o lado obscuro do negócio é revelado com consequências trágicas. Determinada a descobrir os segredos que envolvem essa terra de ninguém, a namorada de Juan, Diana, embarca em uma busca pela verdade.","first_air_date":"2024-10-10","runtime":122,"episode_run_time":[122],"vote_average":6.4,"created_by":["Dynamo"],"production_companies":[{"name":"Dynamo"}],"cast":["Juanes","Alejandro Speitzer","Alberto Guerra","Laura Osma","Norberto Rivera"],"backdrop_path":"https://image.tmdb.org/t/p/original/r4Xn4eWOyxye8m3dR80I8TPhfE5.jpg","poster_path":"https://image.tmdb.org/t/p/original/8XDidaDgghQhcZoNwspuEGFLJAW.jpg","certification":"N/A","genres":["Ação","Crime","Drama"],"trailer":"kGCkCTddNKU"},
"675":{"id":"675","name":"Harry Potter e a Ordem da Fênix","slug":"harry-potter-e-a-ordem-da-fenix","original_title":"Harry Potter and the Order of the Phoenix","overview":"Lord Voldemort está de volta, mas o Ministério da Magia está fazendo tudo a seu alcance para impedir que a comunidade mundial de bruxos descubra isso – incluindo indicar a oficial do Ministério, Dolores Umbridge, como a nova professora de Defesa Contra as Artes das Trevas de Hogwarts. Quando Umbridge se recusa a ensinar a prática de mágica defensiva, Rony e Hermione convencem Harry a secretamente treinar um grupo de estudantes para a guerra de magia que está prestes a estourar.","first_air_date":"2007-07-08","runtime":138,"episode_run_time":[138],"vote_average":7.7,"created_by":["Warner Bros. Pictures","Heyday Films"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Heyday Films"}],"cast":["Daniel Radcliffe","Rupert Grint","Emma Watson","Imelda Staunton","Helena Bonham Carter"],"backdrop_path":"https://image.tmdb.org/t/p/original/82a7AGF081PzFfoM8GAVGMvZNYK.jpg","poster_path":"https://image.tmdb.org/t/p/original/tIf9aUyNljda9MG1pjlOLHCZ3b0.jpg","certification":"L","genres":["Aventura","Fantasia"],"trailer":"Tbv2Al6LGW8"},
"111":{"id":"111","name":"Scarface","slug":"scarface","original_title":"Scarface","overview":"Após receber residência permanente nos Estados Unidos em troca do assassinato de um oficial do governo cubano, Tony Montana se torna o chefe do tráfico de drogas em Miami. Matando qualquer um que entre em seu caminho, Tony eventualmente se torna o maior traficante da Flórida, controlando quase toda a cocaína que entra em Miami. Porém, a pressão da polícia, as guerras com cartéis colombianos e sua própria paranoia servem para alimentar as chamas de sua eventual queda.","first_air_date":"1983-12-09","runtime":166,"episode_run_time":[166],"vote_average":8.2,"created_by":["Universal Pictures","Martin Bregman Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Martin Bregman Productions"}],"cast":["Al Pacino","Steven Bauer","Michelle Pfeiffer","Mary Elizabeth Mastrantonio","Robert Loggia"],"backdrop_path":"https://image.tmdb.org/t/p/original/1qM2BYNE11Viby8ImC9LC00DgDr.jpg","poster_path":"https://image.tmdb.org/t/p/original/4d6ksr4wsBd1fifF7YLAm9wbWiK.jpg","certification":"18","genres":["Ação","Crime","Drama"],"trailer":"N/A"},
