"646683":{"id":"646683","name":"O Exorcismo","slug":"o-exorcismo","original_title":"The Exorcism","overview":"Anthony Miller é um ator com um passado sombrio, marcado pelo abuso de drogas. Durante as filmagens do seu novo filme de terror, ele começa a exibir um comportamento perturbador, levantando suspeitas sobre seu estado mental. Ao investigar o que pode estar acontecendo, sua filha se vê no limite entre a realidade e o sobrenatural e percebe que os problemas que assombram seu pai podem ser mais aterrorizantes do que parecem.","first_air_date":"2024-05-30","runtime":96,"episode_run_time":[96],"vote_average":5.1,"created_by":["Miramax","Outerbanks Entertainment"],"production_companies":[{"name":"Miramax"},{"name":"Outerbanks Entertainment"}],"cast":["Russell Crowe","Ryan Simpkins","Sam Worthington","Chloe Bailey","Adam Goldberg"],"backdrop_path":"https://image.tmdb.org/t/p/original/93dDAqtrFQk5zeofDtQGExPlYjC.jpg","poster_path":"https://image.tmdb.org/t/p/original/fdI9DbwvCSOO4SMDT8spf3SYSqd.jpg","certification":"16","genres":["Terror","Thriller"],"trailer":"o8w_fDPlleA"},
