"273477":{"id":"273477","name":"Como Sobreviver a um Ataque Zumbi","slug":"como-sobreviver-a-um-ataque-zumbi","original_title":"Scouts Guide to the Zombie Apocalypse","overview":"Ben, Carter e Augie são amigos desde que se conheceram no grupo de escoteiros. Enquanto os dois primeiros tentam realizar outras atividades, o último faz questão de convencê-los a acampar mais uma vez. Ben e Carter topam, mas fogem no meio da noite para ir a uma badalada festa secreta na cidade. Chegando ao local, descobrem que tudo foi dominado por zumbis e agora eles têm a missão de sobreviver a esse ataque.","first_air_date":"2015-10-23","runtime":92,"episode_run_time":[92],"vote_average":6.5,"created_by":["Broken Road Productions","Brucks Entertainment","Oops Doughnuts Productions"],"production_companies":[{"name":"Broken Road Productions"},{"name":"Brucks Entertainment"},{"name":"Oops Doughnuts Productions"}],"cast":["Tye Sheridan","Sarah Dumont","Logan Miller","Joey Morgan","David Koechner"],"backdrop_path":"https://image.tmdb.org/t/p/original/hUpHXyLRNvtt0AAwdPmUsSQQKB8.jpg","poster_path":"https://image.tmdb.org/t/p/original/wT88c7CdVYaNTMtDVLw0xrHumfu.jpg","certification":"16","genres":["Comédia","Terror"],"trailer":"N/A"},
