"673":{"id":"673","name":"Harry Potter e o Prisioneiro de Azkaban","slug":"harry-potter-e-o-prisioneiro-de-azkaban","original_title":"Harry Potter and the Prisoner of Azkaban","overview":"Quando a desprezível Tia Guida voa pelo céu na noite, Harry parte para o que será seu terceiro ano em Hogwarts. Um passeio no Nôitibus o leva para o Beco Diagonal onde ele fica sabendo que um prisioneiro foragido, Sirius Black está atrás dele. Em Hogwarts, Harry e seus amigos aprendem a delicada arte de se aproximar de um Hipogrifo, como transformar monstros em risadas e até mesmo a voltar no tempo. Dementadores sugadores de almas pairam sobre Hogwarts, ameaçando Harry, enquanto um seguidor de Aquele-Que-Não-Se-Deve-Nomear espreita pela escola. E Harry será forçado a confrontar todos eles. Dirigido por Alfonso Cuarón e baseado no terceiro livro de J.K. Rowling, essa maravilhosa história traz risadas, suspense e surpresas de tirar o fôlego, a especialidade dos filmes de Harry Potter. Prepare-se!","first_air_date":"2004-05-31","runtime":142,"episode_run_time":[142],"vote_average":8.0,"created_by":["Warner Bros. Pictures","1492 Pictures","Heyday Films","P of A Productions Limited"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"1492 Pictures"},{"name":"Heyday Films"},{"name":"P of A Productions Limited"}],"cast":["Daniel Radcliffe","Rupert Grint","Emma Watson","Robbie Coltrane","Michael Gambon"],"backdrop_path":"https://image.tmdb.org/t/p/original/htmYEfH7TQgzsXHCnNXxmoYKQtL.jpg","poster_path":"https://image.tmdb.org/t/p/original/1HdMUghqlgOIvbsU9ZtO40IPRzl.jpg","certification":"L","genres":["Aventura","Fantasia"],"trailer":"sYSXXatPuxU"},
"955916":{"id":"955916","name":"Lift: Roubo nas Alturas","slug":"lift-roubo-nas-alturas","original_title":"Lift","overview":"Um ladrão profissional e sua equipe tentam fazer um grande assalto: roubar 500 milhões de dólares em barras de ouro de um avião a 40 mil pés de altitude.","first_air_date":"2024-01-12","runtime":107,"episode_run_time":[107],"vote_average":6.5,"created_by":["Genre Films","6th & Idaho Motion Picture Company","HartBeat Productions"],"production_companies":[{"name":"Genre Films"},{"name":"6th & Idaho Motion Picture Company"},{"name":"HartBeat Productions"}],"cast":["Kevin Hart","Gugu Mbatha-Raw","Sam Worthington","Vincent D'Onofrio","Úrsula Corberó"],"backdrop_path":"https://image.tmdb.org/t/p/original/AaModY6YpQmEFzG56ALP1PFLPUU.jpg","poster_path":"https://image.tmdb.org/t/p/original/ca74jjIYRVDdsnlWk8JzyVY49dE.jpg","certification":"12","genres":["Ação","Comédia","Crime"],"trailer":"E9bZ-kyJps0"},
"37165":{"id":"37165","name":"O Show de Truman: O Show da Vida","slug":"o-show-de-truman-o-show-da-vida","original_title":"The Truman Show","overview":"Truman Burbank é um pacato vendedor de seguros que leva um vida simples com sua esposa Meryl Burbank. Porém algumas coisas ao seu redor fazem com que ele passe a estranhar sua cidade, seus supostos amigos e até sua mulher. Após conhecer a misteriosa Lauren, ele fica intrigado e acaba descobrindo que toda sua vida foi monitorada por câmeras e transmitida em rede nacional.","first_air_date":"1998-06-04","runtime":103,"episode_run_time":[103],"vote_average":8.1,"created_by":["Paramount Pictures","Scott Rudin Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Scott Rudin Productions"}],"cast":["Jim Carrey","Laura Linney","Noah Emmerich","Natascha McElhone","Holland Taylor"],"backdrop_path":"https://image.tmdb.org/t/p/original/aCHn2TXYJfzPXQKA6r9mKPbMlUB.jpg","poster_path":"https://image.tmdb.org/t/p/original/k1pwKQs2erSy6q4qhi0tTaXrSOf.jpg","certification":"L","genres":["Comédia","Drama"],"trailer":"N/A"},
"238":{"id":"238","name":"O Poderoso Chefão","slug":"o-poderoso-chefao","original_title":"The Godfather","overview":"Em 1945, Don Corleone é o chefe de uma mafiosa família italiana de Nova York. Ele costuma apadrinhar várias pessoas, realizando importantes favores para elas, em troca de favores futuros. Com a chegada das drogas, as famílias começam uma disputa pelo promissor mercado. Quando Corleone se recusa a facilitar a entrada dos narcóticos na cidade, não oferecendo ajuda política e policial, sua família começa a sofrer atentados para que mudem de posição. É nessa complicada época que Michael, um herói de guerra nunca envolvido nos negócios da família, vê a necessidade de proteger o seu pai e tudo o que ele construiu ao longo dos anos.","first_air_date":"1972-03-14","runtime":175,"episode_run_time":[175],"vote_average":8.7,"created_by":["Paramount Pictures","Alfran Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Alfran Productions"}],"cast":["Marlon Brando","Al Pacino","James Caan","Robert Duvall","Richard S. Castellano"],"backdrop_path":"https://image.tmdb.org/t/p/original/rSPw7tgCH9c6NqICZef4kZjFOQ5.jpg","poster_path":"https://image.tmdb.org/t/p/original/uP46DujkD3nwcisOjz9a0Xw0Knj.jpg","certification":"14","genres":["Drama","Crime"],"trailer":"0v6MO0EB7UY"},
"1100782":{"id":"1100782","name":"Sorria 2","slug":"sorria-2","original_title":"Smile 2","overview":"A sequência vai girar em torno de Quinn Parsons (vivida por Naomi Scott, de Aladdin), uma cantora miserável em turnê que está tentando se recuperar do seu vício em drogas. Ela se tornará alvo da entidade do primeiro filme após seu traficante lhe passar a maldição.","first_air_date":"2024-10-16","runtime":127,"episode_run_time":[127],"vote_average":6.6,"created_by":["Paramount Pictures","Temple Hill Entertainment","Bad Feeling"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Temple Hill Entertainment"},{"name":"Bad Feeling"}],"cast":["Naomi Scott","Rosemarie DeWitt","Lukas Gage","Miles Gutierrez-Riley","Peter Jacobson"],"backdrop_path":"https://image.tmdb.org/t/p/original/iR79ciqhtaZ9BE7YFA1HpCHQgX4.jpg","poster_path":"https://image.tmdb.org/t/p/original/tPGaWmxdPumgOAzbGHu8aRJTaXx.jpg","certification":"18","genres":["Terror","Mistério"],"trailer":"_e-yvJV9NpM"},
"603":{"id":"603","name":"Matrix","slug":"matrix","original_title":"The Matrix","overview":"Thomas Anderson, um jovem programador de computador que mora em um cubículo escuro, é atormentado por estranhos pesadelos nos quais encontra-se conectado por cabos e contra sua vontade, em um imenso sistema de computadores do futuro. Em todas essas ocasiões, acorda gritando no exato momento em que os eletrodos estão para penetrar em seu cérebro. À medida que o sonho se repete, Anderson começa a ter dúvidas sobre a realidade. Por meio do encontro com os misteriosos Morpheus e Trinity, Thomas descobre que é, assim como outras pessoas, vítima da Matrix, um sistema inteligente e artificial que manipula a mente das pessoas, criando a ilusão de um mundo real enquanto usa os cérebros e corpos dos indivíduos para produzir energia. Morpheus, entretanto, está convencido de que Thomas é Neo, o aguardado messias capaz de enfrentar a Matrix e conduzir as pessoas de volta à realidade e à liberdade.","first_air_date":"1999-03-31","runtime":136,"episode_run_time":[136],"vote_average":8.2,"created_by":["Village Roadshow Pictures","Groucho II Film Partnership","Silver Pictures","Warner Bros. Pictures"],"production_companies":[{"name":"Village Roadshow Pictures"},{"name":"Groucho II Film Partnership"},{"name":"Silver Pictures"},{"name":"Warner Bros. Pictures"}],"cast":["Keanu Reeves","Laurence Fishburne","Carrie-Anne Moss","Hugo Weaving","Gloria Foster"],"backdrop_path":"https://image.tmdb.org/t/p/original/icmmSD4vTTDKOq2vvdulafOGw93.jpg","poster_path":"https://image.tmdb.org/t/p/original/qFHE09iQDbpHUBXJ8cFZu9v2ViO.jpg","certification":"12","genres":["Ação","Ficção científica"],"trailer":"mPYfd6PCmYY"},
