"98":{"id":"98","name":"Gladiador","slug":"gladiador","original_title":"Gladiator","overview":"Nos dias finais do reinado de Marcus Aurelius, o imperador desperta a ira de seu filho Commodus ao tornar pública sua predileção em deixar o trono para Maximus, o comandante do exército romano. Sedento pelo poder, Commodus mata seu pai, assume a coroa e ordena a morte de Maximus, que consegue fugir antes de ser pego e passa a se esconder sob a identidade de um escravo e gladiador do Império Romano.","first_air_date":"2000-05-04","runtime":155,"episode_run_time":[155],"vote_average":8.2,"created_by":["Universal Pictures","Scott Free Productions","Red Wagon Entertainment","Mill Film","DreamWorks Pictures"],"production_companies":[{"name":"Universal Pictures"},{"name":"Scott Free Productions"},{"name":"Red Wagon Entertainment"},{"name":"Mill Film"},{"name":"DreamWorks Pictures"}],"cast":["Russell Crowe","Joaquin Phoenix","Connie Nielsen","Oliver Reed","Richard Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/Ar7QuJ7sJEiC0oP3I8fKBKIQD9u.jpg","poster_path":"https://image.tmdb.org/t/p/original/4DUClyGA6OqjXv6yC0Imf6THGfp.jpg","certification":"14","genres":["Ação","Drama","Aventura"],"trailer":"AVPCzVHLAYY"},
