"61791":{"id":"61791","name":"Planeta dos Macacos: A Origem","slug":"planeta-dos-macacos-a-origem","original_title":"Rise of the Planet of the Apes","overview":"Will Rodman é um jovem cientista que pesquisa macacos para obter um tratamento para o mal de Alzheimer, doença que afeta seu pai. Um desses primatas, a quem chamam de César, experimenta uma evolução tão notável na inteligência que o protagonista decide levá-lo para casa para protegê-lo. Quando Will é forçado a colocar o animal em uma cela segura depois que ele ataca um vizinho, César lidera uma revolta animal contra seus captores humanos e a humanidade.","first_air_date":"2011-08-03","runtime":104,"episode_run_time":[104],"vote_average":7.3,"created_by":["Dune Entertainment","Chernin Entertainment","Ingenious Media","Big Screen Productions","20th Century Fox"],"production_companies":[{"name":"Dune Entertainment"},{"name":"Chernin Entertainment"},{"name":"Ingenious Media"},{"name":"Big Screen Productions"},{"name":"20th Century Fox"}],"cast":["Andy Serkis","James Franco","Freida Pinto","John Lithgow","Brian Cox"],"backdrop_path":"https://image.tmdb.org/t/p/original/dENLz9Np9EV5Ro8UIBhbKC8BmSS.jpg","poster_path":"https://image.tmdb.org/t/p/original/qxe4ONZAgtC0mfsIuOyqVU9JREj.jpg","certification":"12","genres":["Thriller","Ação","Drama","Ficção científica"],"trailer":"ZqSI92Slyuo"},
"1813":{"id":"1813","name":"Advogado do Diabo","slug":"advogado-do-diabo","original_title":"The Devil's Advocate","overview":"Kevin Lomax, advogado de uma pequena cidade da Flórida que nunca perdeu um caso, é contratado por John Milton, dono da maior firma de advocacia de Nova York. No início tudo parece correr bem, mas Mary Ann, a esposa do advogado, começa a testemunhar aparições demoníacas. Kevin está empenhado em defender o cliente e cada vez dá menos atenção a sua mulher, enquanto seu misterioso chefe parece sempre saber como contornar cada problema e tudo que perturba o jovem advogado.","first_air_date":"1997-10-17","runtime":143,"episode_run_time":[143],"vote_average":7.5,"created_by":["Monarchy Enterprises B.V.","Regency Enterprises","Kopelson Entertainment","New Regency Pictures","Taurus Film","Warner Bros. Pictures"],"production_companies":[{"name":"Monarchy Enterprises B.V."},{"name":"Regency Enterprises"},{"name":"Kopelson Entertainment"},{"name":"New Regency Pictures"},{"name":"Taurus Film"},{"name":"Warner Bros. Pictures"}],"cast":["Keanu Reeves","Al Pacino","Charlize Theron","Jeffrey Jones","Judith Ivey"],"backdrop_path":"https://image.tmdb.org/t/p/original/d1m5SWHs5Qb1rtn9QCIayF3uQju.jpg","poster_path":"https://image.tmdb.org/t/p/original/qL17FxDhLDeTdgZxOg2MQrY8PMv.jpg","certification":"16","genres":["Drama","Mistério","Thriller","Terror"],"trailer":"vdPlMRhERDk"},
"102651":{"id":"102651","name":"Malévola","slug":"malevola","original_title":"Maleficent","overview":"Motivada por vingança e o desejo feroz de proteger seu reino, Malévola cruelmente coloca uma maldição irrevogável na filha recém-nascida do rei dos humanos, Aurora. Conforme cresce, Aurora enfrenta um conflito fervente entre o reino da floresta, local onde ela cresceu e ama, e o reino humano, que mantém o seu legado. Malévola percebe que Aurora pode ser a chave para a paz no reino e é forçada a tomar medidas drásticas que mudarão para sempre os dois mundos.","first_air_date":"2014-05-28","runtime":97,"episode_run_time":[97],"vote_average":7.1,"created_by":["Walt Disney Pictures","Roth Films"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Roth Films"}],"cast":["Angelina Jolie","Elle Fanning","Imelda Staunton","Sharlto Copley","Lesley Manville"],"backdrop_path":"https://image.tmdb.org/t/p/original/4hfcpHmMEgmFTdnVx4XCtM6dgCG.jpg","poster_path":"https://image.tmdb.org/t/p/original/dk6dGb014XAP7UOV0psttzcuh3E.jpg","certification":"10","genres":["Fantasia","Aventura","Ação","Família","Romance"],"trailer":"Uqg12lAsydY"},
