"330459":{"id":"330459","name":"Rogue One: Uma História Star Wars","slug":"rogue-one-uma-historia-star-wars","original_title":"Rogue One: A Star Wars Story","overview":"Ainda criança, Jyn Erso foi afastada de seu pai, devido à exigência do diretor Krennic de que ele trabalhasse na construção da arma mais poderosa do Império, a Estrela da Morte. Criada por Saw Gerrera, ela teve que aprender a sobreviver por conta própria ao completar 16 anos. Já adulta, Jyn é resgatada da prisão pela Aliança Rebelde, que deseja ter acesso a uma mensagem enviada por seu pai a Gerrera. Com a promessa de liberdade ao término da missão, ela aceita trabalhar para os rebeldes ao lado do capitão Cassian Andor e do robô K-2SO.","first_air_date":"2016-12-14","runtime":133,"episode_run_time":[133],"vote_average":7.5,"created_by":["Lucasfilm Ltd."],"production_companies":[{"name":"Lucasfilm Ltd."}],"cast":["Felicity Jones","Diego Luna","Alan Tudyk","Donnie Yen","Jiang Wen"],"backdrop_path":"https://image.tmdb.org/t/p/original/6t8ES1d12OzWyCGxBeDYLHoaDrT.jpg","poster_path":"https://image.tmdb.org/t/p/original/74C2YX0NLWnozVMRS56d5CKDdEv.jpg","certification":"12","genres":["Ação","Aventura","Ficção científica"],"trailer":"9oISQcXuki0"},
