"679":{"id":"679","name":"Aliens: O Resgate","slug":"aliens-o-resgate","original_title":"Aliens","overview":"Cinquenta e quatro anos após escapar da \"Nostromo\", a tenente Ripley é encontrada a flutuar, perdida no espaço, ainda adormecida. De volta ao nosso planeta, ela conta tudo o que lhe aconteceu, mas ninguém acredita realmente nela, ou lhe parece dar crédito, até que uma colónia de humanos, entretanto criada no planeta onde ela encontrou o primeiro Alienígena, deixa de emitir comunicações subitamente. Ela então é convocada para auxiliar uma expedição militar ao local, sendo a única aparentemente consciente de que o pesadelo está longe do fim.","first_air_date":"1986-07-18","runtime":135,"episode_run_time":[135],"vote_average":8.0,"created_by":["SLM Production Group","20th Century Fox","Brandywine Productions"],"production_companies":[{"name":"SLM Production Group"},{"name":"20th Century Fox"},{"name":"Brandywine Productions"}],"cast":["Sigourney Weaver","Carrie Henn","Michael Biehn","Paul Reiser","Lance Henriksen"],"backdrop_path":"https://image.tmdb.org/t/p/original/jMBpJFRtrtIXymer93XLavPwI3P.jpg","poster_path":"https://image.tmdb.org/t/p/original/hTTt89V7S3e3YGpf6g3Ng9pro1i.jpg","certification":"14","genres":["Ação","Thriller","Ficção científica"],"trailer":"N/A"},
