"9757":{"id":"9757","name":"Norbit - Uma Comédia de Peso","slug":"norbit-uma-comedia-de-peso","original_title":"Norbit","overview":"Norbit foi criado pelo sr. Wong, que o encontrou ainda bebê no Restaurante e Orfanato Wonton Dourado. Foi neste local que ele conheceu sua alma gêmea, Kate. Eles se tornam amigos inseparáveis, até ela ser adotada e deixar o local. Aos 9 anos, Norbit é ameaçado por três garotos da escola mas é salvo por Rasputia (Eddie Murphy), uma robusta garota de 10 anos. Os dois crescem, namoram e se casam. Juntamente com seus irmãos Jack Grandão, Azulão e Earl, Rasputia administra a Construtora Latimore. Norbit é empregado da empresa, sendo sempre ridicularizado pelos cunhados. A vida de Norbit não anda nada bem, mas ela muda após reencontrar Kate, que decide comprar o antigo orfanato do sr. Wong. Porém o que Kate não sabe é que seu noivo, Deion, planeja transformar o local em um bar de strip-tease, contando com a ajuda dos irmãos de Rasputia. Reanimado por ter reencontrado Kate, Norbit ganha confiança e, aos poucos, passa a enfrentar a esposa e sua família.","first_air_date":"2007-02-08","runtime":102,"episode_run_time":[102],"vote_average":5.7,"created_by":["Tollin/Robbins Productions","Davis Entertainment","DreamWorks Pictures","Eddie Murphy Productions"],"production_companies":[{"name":"Tollin/Robbins Productions"},{"name":"Davis Entertainment"},{"name":"DreamWorks Pictures"},{"name":"Eddie Murphy Productions"}],"cast":["Eddie Murphy","Thandiwe Newton","Terry Crews","Clifton Powell","Lester Speight"],"backdrop_path":"https://image.tmdb.org/t/p/original/nMgQD51KzAqrt4F6iwxw5TetVLW.jpg","poster_path":"https://image.tmdb.org/t/p/original/sExfA7YUSXQJRGmOZ9v52lxd16I.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
