"10830":{"id":"10830","name":"Matilda","slug":"matilda","original_title":"Matilda","overview":"Matilda Wormwood (Mara Wilson) é uma criança brilhante de apenas seis anos, que cresceu em meio a pais grosseiros e ignorantes. Seu pai Harry (Danny DeVito) trabalha como vendedor de carros, enquanto que sua mãe Zinnia (Rhea Perlman) é dona de casa. Ambos ignoram a filha, a ponto de esquecerem de matriculá-la na escola. Desta forma Matilda fica sempre em casa ou na livraria, onde costuma estimular sua imaginação. Após uma série de estranhos eventos ocorridos em casa, quando Matilda descobre que possui poderes mágicos, Harry resolve enviá-la à escola. O local é controlado com mão de ferro pela diretora Agatha Trunchbull (Pam Ferris), o que faz com que Matilda apenas se sinta bem ao lado da professora Honey (Embeth Davidtz), que tenta ajudá-la o máximo possível.","first_air_date":"1996-08-02","runtime":98,"episode_run_time":[98],"vote_average":7.2,"created_by":["Jersey Films","TriStar Pictures"],"production_companies":[{"name":"Jersey Films"},{"name":"TriStar Pictures"}],"cast":["Mara Wilson","Danny DeVito","Rhea Perlman","Embeth Davidtz","Pam Ferris"],"backdrop_path":"https://image.tmdb.org/t/p/original/iXlHfi9hq7nfSv31pBab8fpMfZh.jpg","poster_path":"https://image.tmdb.org/t/p/original/anKGylXCQ8NUv41TusuxIxbA06i.jpg","certification":"L","genres":["Comédia","Família","Fantasia"],"trailer":"N/A"},
