"1927":{"id":"1927","name":"Hulk","slug":"hulk","original_title":"Hulk","overview":"Bruce Banner é um cientista e trabalha ao lado de sua grande paixão, a bela Betty Ross, em um projeto que envolve a reconstituição de tecidos com a utilização da radiação gama. O problema todo começa quando, após ter seus genes alterados por um acidente envolvendo a radiação gama, Bruce Banner passa a se transformar em um ser gigantesco e verde que expressa no corpo todos os seus demônios mais íntimos e pessoais.","first_air_date":"2003-06-19","runtime":138,"episode_run_time":[138],"vote_average":5.6,"created_by":["Marvel Enterprises","Universal Pictures","Good Machine","Valhalla Motion Pictures"],"production_companies":[{"name":"Marvel Enterprises"},{"name":"Universal Pictures"},{"name":"Good Machine"},{"name":"Valhalla Motion Pictures"}],"cast":["Eric Bana","Jennifer Connelly","Sam Elliott","Josh Lucas","Nick Nolte"],"backdrop_path":"https://image.tmdb.org/t/p/original/kYd1ZMWvG9K2Jeop3XWXcTpJ2dB.jpg","poster_path":"https://image.tmdb.org/t/p/original/dLEezc8nU4O2i96x68AvpA7xyel.jpg","certification":"14","genres":["Ficção científica","Aventura","Ação"],"trailer":"N/A"},
