"686":{"id":"686","name":"Contato","slug":"contato","original_title":"Contact","overview":"Desde quando era menina, Ellie Arroway tentou manter contato com vidas extraterrestres inteligentes. Deixou de lado sua vida particular e até mesmo o amor do teólogo Palmer Joss. Depois de anos seu sonho se tornou realidade. Com origem na distante estrela Vega, chega à Terra uma informação cifrada e Ellie é a primeira pessoa á captá-la e a única disposta a seguir cegamente a mensagem alienígena. Esta é a sua grande chance de fazer contato, mesmo que para isso tenha que correr risco de vida.","first_air_date":"1997-07-11","runtime":150,"episode_run_time":[150],"vote_average":7.4,"created_by":["South Side Amusement Company","Warner Bros. Pictures"],"production_companies":[{"name":"South Side Amusement Company"},{"name":"Warner Bros. Pictures"}],"cast":["Jodie Foster","Matthew McConaughey","James Woods","John Hurt","Tom Skerritt"],"backdrop_path":"https://image.tmdb.org/t/p/original/yFkUPqBuUnbhYbQL8VFpTrAT9za.jpg","poster_path":"https://image.tmdb.org/t/p/original/jUihxs38jpwhc6rO256h4iRdqNb.jpg","certification":"L","genres":["Drama","Ficção científica","Mistério"],"trailer":"N/A"},
