"792307":{"id":"792307","name":"Pobres Criaturas","slug":"pobres-criaturas","original_title":"Poor Things","overview":"A jovem Bella Baxter é trazida de volta à vida pelo cientista Dr. Godwin Baxter. Querendo ver mais do mundo, ela foge com um advogado e viaja pelos continentes. Livre dos preconceitos de sua época, Bella exige igualdade e libertação.","first_air_date":"2023-12-07","runtime":141,"episode_run_time":[141],"vote_average":7.7,"created_by":["Searchlight Pictures","Film4 Productions","TSG Entertainment","Element Pictures","Limp","Fruit Tree"],"production_companies":[{"name":"Searchlight Pictures"},{"name":"Film4 Productions"},{"name":"TSG Entertainment"},{"name":"Element Pictures"},{"name":"Limp"},{"name":"Fruit Tree"}],"cast":["Emma Stone","Mark Ruffalo","Willem Dafoe","Ramy Youssef","Christopher Abbott"],"backdrop_path":"https://image.tmdb.org/t/p/original/q2E18ybZg0KkpR8nERH67GOGx33.jpg","poster_path":"https://image.tmdb.org/t/p/original/iOdcXYSVzBgmBJzNIlIMOZ6fz0F.jpg","certification":"N/A","genres":["Ficção científica","Romance","Comédia"],"trailer":"9DEOJkmZLd8"},
"32657":{"id":"32657","name":"Percy Jackson e o Ladrão de Raios","slug":"percy-jackson-e-o-ladrao-de-raios","original_title":"Percy Jackson & the Olympians: The Lightning Thief","overview":"Ambientado no mundo atual, onde os doze deuses do Olimpo (instalados 600 andares acima do planeta, no edifício Empire State Building, em Nova York) estão vivos e criando uma nova raça de jovens heróis mitológicos que são semideuses metade mortais, metade imortais, Zeus suspeita que Percy, filho adolescente de Poseidon, tenha roubado seu raio, a arma mais poderosa do universo. Para provar sua inocência e evitar uma guerra devastadora entre os deuses, Percy embarca numa odisséia transcontinental com o objetivo de encontrar o verdadeiro ladrão. Ao longo do caminho, ele enfrenta inimigos cruéis decididos a detê-lo, e salva sua mãe das garras assassinas de outro deus grego, Hades.","first_air_date":"2010-02-01","runtime":119,"episode_run_time":[119],"vote_average":6.2,"created_by":["1492 Pictures","Sunswept Entertainment","Dune Entertainment"],"production_companies":[{"name":"1492 Pictures"},{"name":"Sunswept Entertainment"},{"name":"Dune Entertainment"}],"cast":["Logan Lerman","Brandon T. Jackson","Alexandra Daddario","Jake Abel","Pierce Brosnan"],"backdrop_path":"https://image.tmdb.org/t/p/original/ugiV9SpJburMOPeIyjBJyAnO1So.jpg","poster_path":"https://image.tmdb.org/t/p/original/bcTRDr6wTCEjSeXCGEmHrGhwPqf.jpg","certification":"12","genres":["Aventura","Fantasia","Família"],"trailer":"N/A"},
"436969":{"id":"436969","name":"O Esquadrão Suicida","slug":"o-esquadrao-suicida","original_title":"The Suicide Squad","overview":"Bem-vindos a Belle Reve, a prisão com a maior taxa de mortalidade dos Estados Unidos. É aqui que os piores supervilões são mantidos e onde eles fazem de tudo para sair, até mesmo se unir à misteriosa e supersecreta Task Force X. Qual a missão do dia? Reunir uma equipe de vilões, incluindo Sanguinário, Pacificador, Capitão Bumerangue, Caça-Ratos 2, Sábio, Tubarão-Rei, Blackguard, Dardo e a psicopata favorita de todo mundo, Arlequina. Depois, armá-los até os dentes e soltá-los na ilha remota de Corto Maltese, cheia de inimigos. O Esquadrão atravessa uma selva repleta de oponentes e forças guerrilheiras durante sua missão de busca e abate. Apenas o Coronel Rick Flag e os dispositivos tecnológicos de Amanda Waller são capazes de mantê-los na linha. E, como sempre, basta um movimento errado para que estejam mortos (seja nas mãos de seus oponentes, de um colega de equipe ou da própria Waller).","first_air_date":"2021-07-28","runtime":132,"episode_run_time":[132],"vote_average":7.5,"created_by":["DC Films","Atlas Entertainment","The Safran Company","Warner Bros. Pictures"],"production_companies":[{"name":"DC Films"},{"name":"Atlas Entertainment"},{"name":"The Safran Company"},{"name":"Warner Bros. Pictures"}],"cast":["Margot Robbie","Idris Elba","John Cena","Joel Kinnaman","Sylvester Stallone"],"backdrop_path":"https://image.tmdb.org/t/p/original/rAgsOIhqRS6tUthmHoqnqh9PIAE.jpg","poster_path":"https://image.tmdb.org/t/p/original/wTS3dS2DJiMFFgqKDz5fxMTri.jpg","certification":"16","genres":["Ação","Comédia","Aventura"],"trailer":"kINlkdOysoY"},
