"2493":{"id":"2493","name":"A Princesa Prometida","slug":"a-princesa-prometida","original_title":"The Princess Bride","overview":"A princesa Buttercup é raptada por uma bizarra gangue com um plano mirabolante para criar um incidente internacional. Seus membros logo descobrem que estão sendo perseguidos pelo pirata Roberts, que pode ser também Westley, o único - porém já esquecido - amor da princesa. Uma combinação bizarra de lutas de capa e espada, aventura, fantasia e comédia. Um divertidíssimo trabalho do diretor Rob Reiner.","first_air_date":"1987-09-25","runtime":98,"episode_run_time":[98],"vote_average":7.7,"created_by":["The Princess Bride Ltd.","Buttercup Films Ltd.","Act III Productions"],"production_companies":[{"name":"The Princess Bride Ltd."},{"name":"Buttercup Films Ltd."},{"name":"Act III Productions"}],"cast":["Cary Elwes","Robin Wright","Mandy Patinkin","Chris Sarandon","Christopher Guest"],"backdrop_path":"https://image.tmdb.org/t/p/original/kKJD2hpZ8V20VI4mxEXNrrmAPu1.jpg","poster_path":"https://image.tmdb.org/t/p/original/9tXM8AR7BZ8cu6JkI9FlBl98Vao.jpg","certification":"N/A","genres":["Aventura","Família","Fantasia","Comédia","Romance"],"trailer":"N/A"},
"424694":{"id":"424694","name":"Bohemian Rhapsody","slug":"bohemian-rhapsody","original_title":"Bohemian Rhapsody","overview":"Freddie Mercury e seus companheiros Brian May, Roger Taylor e John Deacon mudam o mundo da música para sempre ao formar a banda Queen, durante a década de 1970. Porém, quando o estilo de vida extravagante de Mercury começa a sair do controle, a banda tem que enfrentar o desafio de conciliar a fama e o sucesso com suas vidas pessoais cada vez mais complicadas.","first_air_date":"2018-10-24","runtime":135,"episode_run_time":[135],"vote_average":8.0,"created_by":["20th Century Fox","Regency Enterprises","GK Films","TSG Entertainment"],"production_companies":[{"name":"20th Century Fox"},{"name":"Regency Enterprises"},{"name":"GK Films"},{"name":"TSG Entertainment"}],"cast":["Rami Malek","Gwilym Lee","Ben Hardy","Joseph Mazzello","Lucy Boynton"],"backdrop_path":"https://image.tmdb.org/t/p/original/7mmXWuBeNJiBO0NIOUWOuFve4Tb.jpg","poster_path":"https://image.tmdb.org/t/p/original/qxgdqcxI216kEoypGbA9BemB7mW.jpg","certification":"14","genres":["Música","Drama"],"trailer":"GryRsVhOvxo"},
"257211":{"id":"257211","name":"Um Senhor Estagiário","slug":"um-senhor-estagiario","original_title":"The Intern","overview":"Jules Ostin é a criadora de um bem-sucedido site de venda de roupas que leva uma vida bastante atarefada, devido às exigências do cargo. Quando sua empresa inicia um projeto de contratar idosos como estagiários, em uma tentativa de colocá-los de volta à ativa, cabe a ela trabalhar com o viúvo Ben Whittaker. Aos 70 anos, Ben leva uma vida monótona e vê o estágio como uma oportunidade de se reinventar. Por mais que enfrente o inevitável choque de gerações, logo ele conquista os colegas de trabalho e se aproxima cada vez mais de Jules, que passa a vê-lo como um amigo.","first_air_date":"2015-09-23","runtime":121,"episode_run_time":[121],"vote_average":7.2,"created_by":["Warner Bros. Pictures","RatPac Entertainment","Waverly Films"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"RatPac Entertainment"},{"name":"Waverly Films"}],"cast":["Robert De Niro","Anne Hathaway","Rene Russo","Anders Holm","JoJo Kushner"],"backdrop_path":"https://image.tmdb.org/t/p/original/rFY9V4Dhq7lbIu6LlpzbL9u2K2E.jpg","poster_path":"https://image.tmdb.org/t/p/original/jjI2z9PvWm69DHzhyYIrsmD6Gj6.jpg","certification":"10","genres":["Comédia"],"trailer":"UCHswQrE2eA"},
